import React from 'react';
import { Link } from 'react-router-dom'; // Assuming you're using react-router for navigation

function CommercialPhotographySection() {
    return (
        <div style={{ background: 'white', padding: '50px 20px', textAlign: 'center' }}>
            <h1 style={{ fontSize: '24px', color: '#333' }}>Commercial Photography in Austin, Texas</h1>
            <p style={{ fontSize: '16px', color: '#666', maxWidth: '600px', margin: '20px auto' }}>
                Crystal is a photographer based in Central Texas, specializing in capturing the essence of commercial spaces. With a keen eye for detail and a passion for showcasing each propertyâ€™s unique character, Crystal helps businesses translate their physical environment into stunning visual narratives.
            </p>
            <Link to="/contact" style={{ display: 'inline-block', marginTop: '20px', padding: '10px 20px', fontSize: '16px', color: 'white', backgroundColor: '#007BFF', textDecoration: 'none', borderRadius: '5px' }}>
                Contact Us
            </Link>
        </div>
    );
}

export default CommercialPhotographySection;
